def solution(stdin: str) -> str:
    """
    Finds maximum number of edges in a path.
    :param stdin: input string
    :return: output string
    """
    n, edges = list(map(int, stdin.split()))
    tree = dict()
    for i in range(1, n + 1):
        tree[i] = set()
    for edge in edges:
        tree[edge[0]].add(edge[1])
        tree[edge[1]].add(edge[0])
    cost = 0
    # Find edges from a to b
    for i in range(1, n + 1):
        for j in range(i + 1, n + 1):
            cost = max(cost, len(tree[i] & tree[j]))
    # Find edges from b to c
    for i in range(1, n + 1):
        for j in range(i + 1, n + 1):
            cost = max(cost, len(tree[i] & tree[j]))
    # Find edges from a to c
    for i in range(1, n + 1):
        for j in range(i + 1, n + 1):
            cost = max(cost, len(tree[i] & tree[j]))
    return str(cost)


