def solution(stdin: str) -> str:
    """
    This function receives a string of numbers
    and returns the largest number of
    segments that intersect with each other.
    """

    n = int(stdin)
    segments = []
    for _ in range(n):
        s = [int(s) for s in stdin.split()]
        segments.append(s)

    # @see https://www.codewars.com/kata/5b55af2c5a92c30f9400002c
    def segment_intersection(segment_a, segment_b):
        # A point is valid if it is in the segment
        def is_valid(point):
            return (
                segment_a[0] <= point[0] < segment_a[1]
                or segment_b[0] <= point[0] < segment_b[1]
            ) and (
                segment_a[0] <= point[1] < segment_a[1]
                or segment_b[0] <= point[1] < segment_b[1]
            )

        def is_in_segment(point):
            if segment_a[0] <= point[0] < segment_a[1]:
                return True
            if segment_b[0] <= point[0] < segment_b[1]:
                return True
            if segment_a[0] <= point[1] < segment_a[1]:
                return True
            if segment_b[0] <= point[1] < segment_b[1]:
                return True
            return False

        # Calculate the intersection of the segments
        # If the intersection is valid, return it
        # if not, return None
        if segment_a[0] == segment_b[0] == segment_a[1] == segment_b[1]:
            if is_in_segment(segment_a[0]):
                return segment_a[0]
            else:
                return None
        if segment_a[0] == segment_b[0]:
            if segment_a[1] > segment_b[1]:
                return segment_a[0]
            else:
                return segment_b[0]
        if segment_a[0] == segment_b[1]:
            if segment_a[1] > segment_b[0]:
                return segment_a[0]
            else:
                return segment_b[1]
        if segment_a[1] == segment_b[0]:
            if segment_a[0] > segment_b[1]:
                return segment_a[1]
            else:
                return segment_b[0]
        if segment_a[1] == segment_b[1]:
            if segment_a[0] > segment_b[0]:
                return segment_a[1]
            else:
                return segment_b[1]

        # Calculate the intersection point
        # Determine if the intersection is valid
        # If it is, calculate the x and y values
        # Return them
        # If not, return None
        x = (
            segment_b[0] * segment_a[1] - segment_a[0] * segment_b[1]
        ) / (segment_a[1] - segment_b[1])
        y = segment_a[0] * x - segment_a[0]
        if is_valid([x, y]):
            return [x, y]
        return None

    # Helper function for calculating the intersection of segments
    def intersection(segment_a, segment_b):
        point = segment_intersection(segment_a, segment_b)
        if point is None:
            return 0
        return point[0] - segment_a[0] + segment_a[1] - point[1]

    # Find the intersection of all segments
    intersections = [segment_intersection(segments[i], segments[j]) for i in range(len(segments)) for j in range(i + 1, len(segments))]
    intersections = [i for i in intersections if i is not None]
    # Find the maximum intersection
    max_intersection = max([intersection(segments[i], segments[j]) for i in range(len(segments)) for j in range(i + 1, len(segments))])

    # Find the segments that intersect the maximum intersection
    max_intersection_segments = [
        segments[i]
        for i in range(len(segments))
        if intersection(segments[i], segments[j]) == max_intersection
    ]

    # Find the segment that intersects the maximum intersection
    # and remove it
    for segment in max_intersection_segments:
        if segment in segments:
            segments.remove(segment)

    # Check if there is an intersection with at least one other segment
    for segment in segments:
        for other_segment in segments:
            if segment is not other_segment:
                if segment_intersection(segment, other_segment) is not None:
                    return max_intersection

    return max_intersection

