    # upper and lower limits of the table
    UPPER = number + 1
    LOWER = number - 1

    # we'll use the fact that for any number, we can reach its square using only the above two values
    # for example, 8 can be reached from 6 and 9, so the difference between those two squares is 6-9 = 3
    # we'll use the same idea for 10, 100, 1000,...
    # so we'll go up from lower to upper and see where we can find the square of N
    for i in range(LOWER, UPPER):
        # by comparing the squares of the two numbers above the one we're on, we'll know if N is the case
        # e.g. if we're at 10, we'll want to look at the 5 and 15
        # but if we're at 100, we'll want to look at 10 and 100
        # so if N is bigger than 10, we'll move N - 10
        if number - i * i > 10:
            return str(i - 1) +'' + str(number - (i - 1) ** 2)
        else:
            return str(i) +'' + str(number - i ** 2)

