    Returns:
        str: A string representing the answer
    """
    n, m, k = [int(x) for x in stdin.split('\n')[0].split()]
    roads = [tuple(int(x) for x in line.split()) for line in stdin.split('\n')[1:]]
    roads = {tuple(sorted([road[0], road[1]])) for road in roads}

    # Defines dp
    dp = [[[0]*(m+1) for j in range(k+1)] for i in range(n+1)]
    dp[1][1][0] = 1

    # Fills the first column
    for i in range(1, n+1):
        if i in roads:
            continue
        dp[i][1][0] = 1

    # Fills the first row
    for j in range(1, m+1):
        if (1, j) in roads:
            continue
        dp[1][j][0] = 1

    # Fill the dp
    for i in range(1, n+1):
        for j in range(1, m+1):
            if i in roads:
                continue
            if j in roads:
                continue
            for jj in range(1, m+1):
                if jj in roads:
                    continue
                dp[i][j][jj] = dp[i-1][j][jj] + dp[i][j-1][jj] - dp[i-1][j-1][jj]
            dp[i][j][0] = dp[i-1][j][0] + dp[i][j-1][0]

    # The answer
    ans = min(dp[n][j][j] for j in range(1, m+1))
    return ans

